  int start = 0;
  int startModule = 0;
  bool isPaused = false;
  PlayerState? _playerState;
  bool stopFunction = false;

  @override
  void initState() {
    super.initState();

    Future.delayed(
      const Duration(seconds: 2),
      () async {
        _showNextText();
      },
    );
  }

  Future<void> _waitForFlagToChange() async {
    while (isPaused) {
      await Future.delayed(const Duration(milliseconds: 100));
    }
  }

  Future<void> _waitForTitle(bool title) async {
    while (!title) {
      await Future.delayed(const Duration(milliseconds: 100));
    }
  }

  int moduleLength = 0;
  int moduleId = 0;
  int stepId = 0;

  void _showNextText() async {
    while (!stopFunction) {
      for (int i = start;
          (ref.read(mapListProvider)[startModule]["steps"].length - start <= 4
              ? i <= ref.read(mapListProvider)[startModule]["steps"].length
              : i < start + 5);
          i++) {
        if (stopFunction) {
          break; // Exit the loop if stopFunction is true
        }

        if (isPaused) {
          await _waitForFlagToChange();
        }

        await Future.delayed(const Duration(seconds: 2), () async {
          if (isPaused) {
            await _waitForFlagToChange();
          }
        });

        if (currentIndex == 5) {
          if (isPaused) {
            await _waitForFlagToChange();
          }
          print("if part...............................");

          setState(() {
            _visibilityList = [false, false, false, false, false];
          });

          await Future.delayed(const Duration(seconds: 2), () async {
            if (isPaused) {
              await _waitForFlagToChange();
            }
          });

          if (isPaused) {
            await _waitForFlagToChange();
          }
          setState(() {
            start += 5;
            currentIndex = 0;
            print("Start $start");
            print("currentIndex $currentIndex");
          });

          break;
        } else if (i ==
            ref.read(mapListProvider)[startModule]["steps"].length) {
          if (isPaused) {
            await _waitForFlagToChange();
          }

          print("last part..........................");
          setState(() {
            titleVisibility = false;
            _visibilityList = [false, false, false, false, false];
            print("titleVisibility $titleVisibility");
          });

          await Future.delayed(
            const Duration(seconds: 2),
            () async {
              if (isPaused) {
                await _waitForFlagToChange();
              }
            },
          );
          if (isPaused) {
            await _waitForFlagToChange();
          }
          if (titleVisibility == false) {
            await _waitForTitle(titleVisibility);
          }

          if (ref.read(mapListProvider)[startModule]["id"] !=
              ref.read(mapListProvider).length) {
            setState(() {
              moduleLength++;
              start = 0;
              currentIndex = 0;
              startModule++;
              print("start $start");
              print("currentIndex $currentIndex");
            });
          } else {
            break;
          }
        } else {
          print("i..................................$i");
          if (i == 0) {
            if (isPaused) {
              await _waitForFlagToChange();
            }
            print("first part.....................");
            setState(() {
              titleVisibility = true;
              print(titleVisibility);
            });

            if (isPaused) {
              await _waitForFlagToChange();
            }
            await Future.delayed(const Duration(seconds: 1), () async {
              if (isPaused) {
                await _waitForFlagToChange();
              }
            });
          }

          if (isPaused) {
            await _waitForFlagToChange();
          }

          print("else part...............................");

          if (isPaused) {
            await _waitForFlagToChange();
          }
          setState(() {
            _visibilityList[currentIndex] = true;
            print(_visibilityList);
          });

          if (isPaused) {
            await _waitForFlagToChange();
          }

          ref
              .read(mapListProvider.notifier)
              .updateStepState(startModule, i, true);
          print(
              "$startModule....$i.....${ref.read(mapListProvider)[startModule]["steps"][i]["state"]}");

          await player.play(AssetSource(
              ref.read(mapListProvider)[startModule]["steps"][i]["Voice"]));
          _playerState = player.state;

          while (_playerState == PlayerState.playing) {
            await Future.delayed(const Duration(milliseconds: 100));
            _playerState = player.state;
          }

          await Future.delayed(const Duration(seconds: 1), () async {
            if (isPaused) {
              await _waitForFlagToChange();
            }
          });
          if (isPaused) {
            await _waitForFlagToChange();
          }

          await Future.delayed(const Duration(seconds: 3), () async {
            if (isPaused) {
              await _waitForFlagToChange();
            }
          }).then((value) async {
            if (_playerState == PlayerState.paused) {
              print("Paused State........................");
              print("Will skip to next iteration..............");
              setState(() {
                currentIndex++;
                print(currentIndex);
              });
            } else {
              print("Next................");
              setState(() {
                currentIndex++;
                print(currentIndex);
              });
            }
          });
          if (isPaused) {
            await _waitForFlagToChange();
          }
        }
        ref
            .read(mapListProvider.notifier)
            .updateStepState(startModule, i, false);
        print(
            "$startModule....$i.....${ref.read(mapListProvider)[startModule]["steps"][i]["state"]}");
      }
    }
  }

  void _togglePause() async {
    if (isPaused) {
      setState(() {
        stopFunction = true;
        print("stopFunction: $stopFunction");
        print("_playerState: $_playerState");
      });
      if (_playerState == PlayerState.playing) {
        print("_playerState: $_playerState");
        await player.pause();
      }
    } else {
      if (_playerState == PlayerState.paused) {
        setState(() {
          stopFunction = true;
          print("stopFunction: $stopFunction");
          print("_playerState: $_playerState");
        });
        await player.resume();
        setState(() {
          stopFunction = false;
          print("stopFunction: $stopFunction");
          print("_playerState: $_playerState");
        });
      } else {
        setState(() {
          stopFunction = false;
          print("stopFunction: $stopFunction");
          print("_playerState: $_playerState");
        });
      }
    }
  }

  Widget _text(String text, bool isVisible, int index) {
    double WIDTH = MediaQuery.of(context).size.width;
    double HEIGHT = MediaQuery.of(context).size.height;
    return AnimatedOpacity(
      opacity: isVisible ? 1.0 : 0.0,
      duration: const Duration(seconds: 2),
      child: SizedBox(
        width: WIDTH * 0.5,
        // color: Colors.amber,
        child: Padding(
          padding: EdgeInsets.symmetric(horizontal: WIDTH * 0.05),
          child: Row(
            crossAxisAlignment: CrossAxisAlignment.start,
            mainAxisAlignment: MainAxisAlignment.start,
            children: [
              Padding(
                padding:
                    EdgeInsets.only(top: HEIGHT * 0.0025, right: WIDTH * 0.01),
                child: const Icon(Icons.check, color: Colors.green),
              ),
              Flexible(
                child: Text(
                  text,
                  style:
                      TextStyle(color: Colors.black, fontSize: HEIGHT * 0.011),
                  softWrap: true,
                ),
              ),
            ],
          ),
        ),
      ),
    );
  }

